var mobileController = (function () {
    
    init()
    
    function init() {
        bind_events()
    }

    function bind_events() {
        $("html").on("click", ".burger", function(){
            console.log("burger")
            $(this).toggleClass("is-active")
            if($(this).hasClass("is-active")){
                $(".nav").show();
                $("header").addClass("is-active")
            }else{
                $(".nav").hide();
                $("header").removeClass("is-active")
            }

        });

        $(".touchevents nav a").on("click", function(){
            $(".burger").click();
        });
    
    }

})();
var pull = (function () {
    var c = 0;
    init()

    function init() {
        $("#pull").on("click", function(){
            
            $.ajax({
              method: "GET",
              url: '/api/all'
            })
            .done(function( data ) {
                console.log(data)
                pull(data);
                for(var i in data[i]){

                }
            });
        })
    }

    function pull(data) {
        var id = data[c]._id;
        console.log("calling : "+data[c].name)
        $.ajax({
          method: "GET",
          url: '/api/media/'+id
        })
        .done(function( res ) {
            
            c++;
            if(c < data.length){
                console.log("res")
                console.log(res)
                pull(data);
                var html = "";
                //var html += $("#result").html();
                if(res)html += "<div>"+c+" : "+res.name+" : "+res.image+" - "+res.color+"</div>";
                html += $("#result").html();
                if(res)$("#result").html(html)
            }else{
                var html = $("#result").html();
                html += "<div>done !!</div>";
                $("#result").html(html)
                console.log("done");
            }
        });
        
    }

})();
var screensaverController = (function () {
    
    var delay = 10000;

    init()
    
    function init() {
        //$("#screensaver").hide();
        bind_events()
        delay_show();
    }

    function bind_events() {
        pubsub.on("changing", function(){
            delay_show();
        });

        window.addEventListener('mousemove', function(event){
            delay_show();
        });

        window.onblur = function() {
            console.log("onblur")
            delay_show();
        };
    }

    function delay_show(){
        $("#screensaver").hide();

        clearTimeout($.data(self, 'screensaverTimer'));
        $.data(self, 'screensaverTimer', setTimeout(function() {
            $("#screensaver").show();
        }, delay));
    }

})();
var scrollController = (function () {
    
    var loading = false;

    init();

    function init(){
        titles();
        infinite()

        pubsub.on("navChanged", function(){
            titles();
        });
    }
    
    function titles(){
        var max = $(".autoradio").width()
        $(".autoradio:not(.can) .name").each(function(idx, el){
            var w = $(el).width();
            //console.log(w, max)
            if(w > max)$(el).parent().addClass("can");
        })
    }

    function infinite(){
        
        var threshold = 200;
        $(window).scroll(function() {       
            //console.log($(window).scrollTop() + $(window).height() + threshold, $(document).height())
            if(($(window).scrollTop() + $(window).height() + threshold) > $(document).height()) {
                if(!loading && $(".liste"))$(".more").click();
            }

            if($(window).scrollTop() > threshold){
                $("header").addClass("affix");
            }else{
                $("header").removeClass("affix");
            }
         });    

        $("html").on('click', '.more', function(event) {
            event.preventDefault();
            
            $("body").addClass("is-exiting");
            loading = true;

            pubsub.emit("changing", null);

            //console.log(window.location)
            var path = window.location.origin
            if(window.location.href.indexOf("random") > -1)path = window.location.href;
            if(window.location.href.indexOf("images") > -1)path = window.location.href;

            var page = $("#page").val();
                page++;
            $("#page").val(page);
console.log(path)
            var u = path+'/page/'+page;

            $.ajax({
                type: "GET",
                url: u
            })
                .done(function( html ) {
                    $(".liste").append(html);

                    $("body").removeClass("is-exiting");
                    loading = false;
                    titles();

                    pubsub.emit("changing", null);
                });
        });
    }

})();
var navController = (function () {
    
    bind_events()
    
    function bind_events() {
        $("html").on("click", "a.no-smoothState", function(e){
            e.preventDefault();
            $("#search").removeClass("slideTop");
            setTimeout(function(){
                $("input[name='s']").focus();
            }, 400);
        });

        $("html").on("mouseenter", "a.no-smoothState", function(e){
            $("#search").removeClass("slideTop");
            setTimeout(function(){
                $("input[name='s']").focus();
            }, 400);
        });

        $("html").on("mouseleave", "header", function(e){
            $("#search").addClass("slideTop");
        });

        $(document).on( 'mousedown', '#s', function(e) {
            if(this.value == "SEARCH")this.value = "";
        });

        $(document).on( 'keyup', '#s', function(e) {
            e.stopPropagation();

            var value = this.value;

            if(this.value.length > 3){
                $("body").addClass("loading");
                $.ajax({
                  method: "GET",
                  url: '/s/'+value
                })
                .done(function( data ) {
                    $(".liste").html(data)
                    history.pushState({}, 'SEARCHING : '+value,'/search/'+value)
                    if(!data)get_page(document.title, "/")
                    $("body").removeClass("loading");
                });
            }
        });

    }

})();